(1, 'Women\'s 720 High-Rise Super-Skinny Jeans', 1, 2, 1, '75', 105.00, '87', '25356', 1, 1, '2020-07-29 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Levi\'s&reg; brand new 720 High Rise Super Skinny offers a bold, fashion-forward look you\'ll reach for all season and beyond. This pair is made from HyperSculpt, next-level denim that\'s softer than ever. They blended three stretch Lycra&reg; fibers with cotton to create this revolutionary fabric that sculpts, smooths and holds its shape. It\'s the 535 Super Skinny transformed</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:32:47'),
(2, 'Women\'s One Logo Leggings', 1, 3, 1, '30', 60.00, '50', '53467', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 192, 1, 10, '<p>Slender lines of logos update this sleek look from Nike, leggings in soft, moisture-wicking fabric that\'s comfortable enough to wear all day.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:32:40'),
(3, 'Capri Pull-On Pants', 1, 4, 1, '23', 39.00, '65', '673438', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 74, 1, 10, '<p>A casual essential with timeless appeal, these relaxed capri pants from Karen Scott quickly will become a go-to.&nbsp;</p>\n<p>Approx. model height is 5\'10\" and she is wearing a size medium/6</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:32:31'),
(4, 'Waverly Skinny Jeans', 1, 5, 1, '50', 79.50, '65', '56689', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 18, 1, 30, '<p>Little touches of Tommy Hilfiger style &mdash; from red threading to a flag belt loop &mdash; appear throughout these classic skinny jeans, giving them a signature TH vibe.&nbsp;</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:32:23'),
(5, 'Women\'s Tiro Climacool Soccer Pants', 1, 6, 1, '30', 45.00, '67', '53674', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 193, 1, 30, '<p>Train hard. Stay cool. These football pants battle the heat with breathable, quick-drying fabric. Cut for movement, they have a slim fit and stretchy ribbed details on the lower legs to promote clean footwork. Ankle zips allow you to pull them on or off over shoes. Slim fit is cut close to the body Full length, approx. inseam - 27\" Elastic waist with drawstring Polyester Machine washable Imported</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:32:14'),
(6, 'Cropped Cargo Pants', 1, 5, 1, '44.99', 79.99, '57', '68678', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 52, 1, 8, '<p>Get set for adventure in these cropped cargo pants from Tommy Hilfiger, with pockets galore.&nbsp;</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:32:06'),
(7, 'High-Rise Stretch Skinny Jean, in Regular & Petite Sizes', 1, 7, 1, '80', 98.00, '79', '7896', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 1, 1, 10, '<p>The Selma high rise skinny jeans from Michael Michael Kors are designed with a hint of stretch and a plenty of handy pockets. Available in Regular &amp; Petite Sizes</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:31:53'),
(8, 'Women\'s Pearl Essence Tiro ClimaCoolÂ® Soccer Pants', 1, 6, 1, '25', 50.00, '54', '345346', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 56, 1, 10, '<p>A pitch-perfect look with ClimaCool&reg; ventilation that helps keep you going, these adidas soccer pants are in a sleek, tapered fit that won\'t impede your footwork.&nbsp;</p>\n<p>&nbsp;</p>\n<p>Approx. model measurements: height: 5\'9\"; bust: 32\"; waist: 25\"; hips: 35\"</p>\n<p>Full length; approx. inseam: 28\"; tapered leg</p>\n<p>INSPIRED FOR: Soccer</p>\n<p>ClimaCool&reg; ventilation</p>\n<p>Three stripes at sides</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:31:45'),
(9, 'Wide-Leg Pull-On Pants', 1, 8, 1, '45', 75.00, '56', '6967', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 64, 1, 10, '<p>Calvin Klein\'s leisure-chic pull-on pants get added comfort and style from a roomy wide leg.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:31:37'),
(10, 'Trendy Plus Size 415 Classic Bootcut Jeans', 1, 2, 1, '39', 76.00, '56', '54799', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>A leg-lengthening boot cut and a classic, stretch fit add up to style plus comfort in these plus size 415 jeans from Levi\'s&reg;. The Blue Sunday wash is a great look with anything from your much-loved tee to a new floaty top. Our designers came up with new, innovative ways to get the denim finishes you love, using a lot less water. We call it Levi\'s Water&lt;less&trade;. available=\"\" in=\"\" select=\"\" washes.=\"\" levi\'s&reg;=\"\" is=\"\" serious=\"\" about=\"\" saving=\"\" water=\"\" -=\"\" with=\"\" 50%=\"\" of=\"\" their=\"\" products=\"\" now=\"\" made=\"\" less&trade;=\"\" techniques,=\"\" more=\"\" than=\"\" 1.8=\"\" billion=\"\" liters=\"\" saved,=\"\" and=\"\" 129=\"\" million=\"\" recycled.=\"\" &lt;=\"\" p=\"\"&gt;&lt;/less&trade;.&gt;</p>\n<p>Mid rise</p>\n<p>Relaxed fit through hips and thighs</p>\n<p>Boot cut leg</p>\n<p>Zip fly with button closure; belt loops</p>\n<p>Five-pocket styling</p>\n<p>Stretch heavyweight denim</p>\n<p>Available in select washes. Levi\'s&reg; is serious about saving water - with 50% of their products now made with Water Less&trade; techniques, more than 1.8 billion liters of water saved, and 129 million liters of water recycled.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:31:27'),
(11, 'Tribeca Plaid Knit Pants', 1, 25, 1, '39', 79.00, '52', '5346', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Varsity stripes trim timeless plaid, bringing a fun look to these knit pants from Tommy Hilfiger.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:31:07'),
(12, 'Logo Tropical Mesh Leggings', 1, 9, 1, '40', 65.00, '50', '4567', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Hit the ground running in fabulous fashion in these mixed-media active leggings from GUESS, designed with mesh insets and bold tropical-inspired prints.</p>\n<p>Approx. model height is 5\'10\" and she is wearing a size small</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:30:59'),
(13, 'Cotton Palazzo Pants', 1, 10, 1, '49', 79.00, '77', '7567', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Sport the cool chic look with these palazzo design pants by Mango. Part of Mango\'s committed collection, these 100% cotton, pleated pants, sport zip and hook fastening for your comfort and style.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:30:35'),
(14, 'High-Rise Skinny Ankle Jeans', 1, 8, 1, '45', 79.00, '82', '5778', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Wide slices at the raw-edge hemline give a laid-back finish to these high-rise skinny ankle jeans from Calvin Klein Jeans.</p>\n<p>Approx. model height is 5\'10\" and she is wearing a size 28</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:30:27'),
(15, 'Sutton Boot-Leg Trousers', 1, 5, 1, '60', 89.00, '45', 'NH68', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>A classic bootleg silhouette pairs with rich twill material on these tailored career pants from Tommy Hilfiger.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:30:16'),
(16, 'Juniors\' Cowlneck Geo-Print Metallic Dress', 1, 11, 1, '31', 79.00, '44', '4679', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Be stunning in bebe\'s sleek cowlneck dress, styled with flattering ruching and a subtle metallic geometric pattern.</p>\n<p>Approx. model height is 5\'10\" and she is wearing a size M</p>\n<p>Approx. 24\" long from center back neck to hem. Length is based on size M and varies 1/4\" between sizes</p>\n<p>Cowlneck</p>\n<p>Back zipper closure</p>\n<p>Cross-back straps</p>\n<p>Ruched at side</p>\n<p>IMPORTANT NOTE: This item arrives with a return tag attached and instructions for removal. Once the tag is removed from the dress, this item cannot be returned.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:30:07'),
(17, 'Printed Jersey Bell Sleeve A-line Dress', 1, 5, 1, '68', 99.00, '45', '4512', 1, 1, '2020-07-29 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Tommy Hilfiger\'s versatile a-line dress is a polished pick any day of the week, designed with 3/4-length bell sleeves for a retro-inspired finish.</p>\n<p>Model is 5\'10\" and she is wearing a size 4</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:29:59'),
(18, 'Lace Illusion Halter Dress', 1, 9, 1, '81', 120.00, '45', '6567', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Get date-night ready with a captivating GUESS dress covered in peekaboo lace and form-fitting ribbing.</p>\n<p>Hidden back zipper with hook-and-eye closure</p>\n<p>Knee length</p>\n<p>Illusion halter neckline, straight at bust; sheath silhouette</p>\n<p>Allover lace and ribbing; open-back with strap detail</p>\n<p>Illusion hem</p>\n<p>IMPORTANT NOTE: This item arrives with a return tag attached and instructions for removal. Once the tag is removed from the dress, this item cannot be returned.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:29:41'),
(19, 'Ruffle V-Neck Chiffon Dress', 1, 1, 1, '89', 129.00, '65', '4524', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Give basic dresses the cold shoulder with this ruffled update from DKNY, cut with an elongating V-neckline in airy chiffon.</p>\n<p>Approx. model height is 5\'10\" and she is wearing a size 4</p>\n<p>Approx. 37\" long from center back neck to hem. Length is based on size 4 and varies 1/4\" between sizes</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:29:24'),
(20, 'Crochet Long Dress', 1, 10, 1, '49.99', 99.99, '65', '4545', 1, 1, '2020-07-29 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>This long tailored dress with a turtleneck design by Mango creates a unique style statement. This crochet fabric dress is a fashionable choice that sports button fastenings at the neck.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:29:04'),
(21, 'Sequined Lace Gown', 1, 12, 1, '499', 798.00, '56', '53232', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>MAC DUGGAL\'s romantic gown is designed with a mix of sparkling sequins and gorgeous lace throughout.</p>\n<p>Approx. model height is 5\'10\" and she is wearing a size 4 Approx.</p>\n<p>IMPORTANT NOTE: This item arrives with a return tag attached and instructions for removal. Once the tag is removed from the dress, this item cannot be returned. Shell, lining: polyester Spot clean only Imported</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:27:18'),
(22, 'Belted Cotton Shirtdress', 1, 5, 1, '62.65', 89.50, '101', '4548', 1, 1, '2020-07-17 00:00:00', 0, 1, 1, 1, 18, 1, 10, '<p>Tommy Hilfiger\'s shirtdress plays it cool in crisp cotton patterned with classic checks. Belt it with the included sash for a true-to-you fit.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:27:08'),
(23, 'One-Shoulder Long-Sleeve Gown', 1, 12, 1, '200', 400.00, '45', '4584', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Get noticed in this gorgeously draped gown by MAC DUGGAL. It\'s the perfect shoulder-flaunting style to show off at your next soir&eacute;e, right down to its glittery sleeve cuffs.</p>\n<p>Approx. model height is 5\'10\" and she is wearing a size 4</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:26:59'),
(24, 'Short Sleeve Floral Fit & Flare Dress', 1, 1, 1, '75', 182.00, '454', '4454', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Get in on the floral trend with this short-sleeved fit-and-flare dress by DKNY, featuring an allover, printed design.</p>\n<p>Approx. model height is 5\'10\" and she is wearing a size 4</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:26:51'),
(25, 'Long-Sleeve Fitted Denim Dress', 1, 9, 1, '66', 135.00, '45', '4482', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Denim diva: Embrace the effortlessly cool aesthetic of this GUESS button-up dress that fits like a (fashionable) glove.</p>\n<p>Approx. model height is 5\'10\" and she is wearing a size small</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:26:41'),
(26, 'Detail Button Dress', 1, 10, 1, '39.99', 79.99, '55', '25741', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Look stylish and chic in this short and flared unique Mango dress. It comes with fancy buttons on the front, square neck, short sleeves and back zip with adjustable belt.</p>\n<p>Approximate model height is 5\'10\" and she is wearing a size XS</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:26:32'),
(27, 'Cotton Mixed-Print Shirtdress', 1, 5, 1, '54', 95.00, '35', '5344', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Tommy Hilfiger puts fashion in focus with this long-sleeve cotton shirtdress designed with a playful mix of floral and gingham prints.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:26:21'),
(28, 'Women\'s Jacquard Bodycon Long Sleeve Midi Dress', 1, 13, 1, '49', 79.00, '7', '4545', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Superdry women\'s jacquard bodycon long sleeve midi dress. Some things never go out of style and neither does this bodycon dress in a classic ribbed fabric, featuring a rear zip fastening and split side seams. Perfect for wearing with your favorite boots for a laidback and contemporary look.</p>\n<p>Model wears US size 6</p>\n<p>Superdry logo branding on the neckline</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:26:04'),
