(30, 'Gabby Smocked Floral-Print Mini Dress', 1, 9, 1, '59', 108.00, '82', '5451', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 61, 1, 10, '<p>Enhance your curves in this gorgeous floral dress from GUESS.</p>\n<p>Approx. model height is 5\'10\" and she is wearing size small</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:25:42'),
(31, 'Sport Striped-Logo High-Waist Bike Shorts', 1, 1, 1, '20', 39.00, '52', '4454', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 17, 1, 10, '<p>A great all-purpose piece with signature style, these DKNY Sport bike shorts give you a sleek fit and high-rise comfort and support.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:25:28'),
(32, 'Faded Denim Skirt', 1, 10, 1, '29.75', 59.00, '65', '5959', 1, 1, '2020-07-17 00:00:00', 0, 1, 1, 1, 17, 1, 10, '<p>Denims are a timeless classic and a must-have for every wardrobe. This midi-design faded denim skirt by Mango with decorative seams is made from sustainable denim style cotton fabric for a classic stylish look on weekends.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:25:19'),
(33, 'Hollywood Shorts', 1, 5, 1, '24.75', 49.50, '4', '7841', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 2, 1, 1, 45, '<p class=\" c-m-v-1\" data-auto=\"product-description\">Cool and classic, these Tommy Hilfiger shorts are a timeless go-to for effortless weekend style.</p>\n<p>Mid rise; straight fit through hips and thighs</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:25:07'),
(34, 'Belted Chambray Skort', 1, 4, 1, '19.75', 39.50, '48', '5485', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 7, 1, 12, '<p class=\" c-m-v-1\" data-auto=\"product-description\">A playful casual look in classic chambray, this Karen Scott skort brings fun and stylish versatility to your collection.</p>\n<p>Approx. model height is 5\'10\" and she is wearing a size medium</p>\n<p>Due to generous sizing, we suggest sizing down for the perfect fit</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:24:59'),
(35, 'High-Rise Distressed Denim Shorts', 1, 2, 1, '19', 45.00, '45', '41546', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 165, 1, 9, '<p>Designed with a high waist for a flattering, fresh feel, Levi\'s&reg; denim shorts feature edgy distressing and a cool raw hem.</p>\n<p>Approx. model height is 5\'10\" and she is wearing a size 27</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:24:47'),
(36, 'Ribbed Graphic Pencil Skirt', 1, 8, 1, '25', 50.00, '21', '2424', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 7, 1, 5, '<p>Sporty meets sassy in this stretchy pencil skirt from Calvin Klein Jeans.</p>\n<p>Approx. model height is 5\'10\" and she is wearing a size small</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:24:33'),
(37, 'Women\'s Dri-FIT Tempo Running Shorts', 1, 3, 1, '19', 35.00, '45', '748548', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 243, 1, 5, '<p>Track is back.. get underway in these performance running shorts from Nike.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:24:26'),
(38, 'Ruffled Floral-Print Skirt', 1, 7, 1, '15', 37.00, '54', '98754', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 14, 1, 5, '<p>Flouncy ruffles in floral print fall into a lovely high-low hemline in this light and airy skirt from Tommy Hilfiger.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:24:14'),
(39, 'High Waist Running Shorts', 1, 15, 1, '19.99', 55.00, '23', '654', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 3, 1, 10, '<div style=\"display: none;\">&nbsp;</div>\n<p>The high waist Running Short will quickly become your new go-to. With an in-built bike short underlayer and a wide stretch waistband, this Running Short is all about comfort while you focus on your workout.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:24:06'),
(40, 'Women\'s Ellison Textured Lace Skirt', 1, 13, 1, '39.95', 53.00, '45', '65345', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 18, 1, 5, '<p>Nothing says summer like a cute flowy skirt. With the Ellison textured lace skirt you get a combination of sheer fabric with an all over print, and elegant lace detailing.</p>\n<p>Model wears US size 6</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:23:58'),
(41, 'Gingham Shorts', 1, 5, 1, '24', 69.00, '45', '6515', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 85, 1, 5, '<p>Playful and polished, these Tommy Hilfiger shorts feature sleek lines and a whimsical gingham print.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:23:43'),
(42, 'Striped Wrap Midi Skirt', 1, 109, 1, '25', 34.00, '45', '52165', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 2, 1, 1, 10, '<p>1.STATE\'s fashionable wrap skirt flows around you with every step. Pair it with a fun wedge or strappy heel for a chic weekend look.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:22:56'),
(43, 'Claudia High-Rise Frayed Denim Shorts', 1, 9, 1, '35', 88.00, '55', '6587', 1, 1, '2020-07-17 00:00:00', 0, 1, 3, 1, 12, 1, 10, '<p>Destructed denim done right. GUESS\' Claudia Jean Shorts are ripped, frayed and faded in all the right places for that lived-in look you love.</p>\n<p>Approx. model height is 5\'10\" and she is wearing size 27</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:22:45'),
