(88, 'Meaggann Pumps', 1, 4, 1, '09', 24.00, '45', '7159', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 15, 1, 10, '<p class=\" c-m-v-1\" data-auto=\"product-description\">Simple and stunning, the chic office-ready Meaggann pumps from Karen Scott are a low-profile look that is appropriate for just about any occasion.</p>\n<p class=\" c-m-v-1\" data-auto=\"product-description\">&nbsp;</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:13:34'),
