(92, 'Haloe2 Wedge Thong Sandals', 1, 14, 1, '8', 19.00, '644', '6344', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>The Haloe wedge thong sandals by Style &amp; Co are such a versatile style. You\'ll love wearing them day after day.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:12:50'),
(93, 'Women\'s Palm Sandals', 1, 24, 1, '11', 33.00, '65', '5721', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 2, 201, 1, 10, '<p>Asymmetrical lines swirl into a chic toe-ring silhouette in the pretty Palm sandals from Kenneth Cole New York.</p>\n<p>&nbsp;</p>', 2, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:12:44'),
(94, 'Women\'s Cloudsteppers Brinkley Jazz Sandals', 1, 23, 1, '11', 33.00, '54', '42345', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 13, 1, 10, '<p>This feather-light Cloudsteppers flip flop is secured by an easy hook and loop closure. Its EVA midsole and footbed give it durability and comfort without adding additional weight. Perfect for the beach, latte runs, long flights and more.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:12:32'),
(95, 'Women\'s Travel Rock Stud Flat Sandals', 1, 21, 1, '29', 69.00, '95', '2356', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 14, 1, 10, '<p>Pyramid studs at metallic moto flash to the gladiator inspired strappy silhouette of Steve Madden\'s Travel sandals.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:12:24'),
(96, 'Easten Slide Sandals', 1, 26, 1, '12', 22.00, '54', '4849', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>An understated duo of wide straps tops off the sensible wedge heel lift of the versatile Easten sandals from Sun + Stone.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:12:13'),
(97, 'Women\'s Jeri Leather Sandals', 1, 27, 1, '25', 60.00, '45', '4891', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 5, 18, 1, 10, '<p>Oversized signature logo hardware makes a statement with a gladiator-inspired profile in the Jeri T-strap sandals by COACH.</p>\n<p>&nbsp;</p>', 5, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:12:03'),
(98, 'MK Plate Flat Thong Sandals', 1, 7, 1, '15', 59.00, '65', '4548', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>No matter what you\'re wearing, the MK Plate Thong Sandals by MICHAEL Michael Kors will fit right in--and they come in multiple colors so you can wear a pair every day of the week! The metallic plate on the front adds a touch of grown-up glamour to a fun, old-school style.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:11:54'),
(99, 'Tutu Bow Flip Flops', 1, 9, 1, '20', 39.00, '51', '7879', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 82, 1, 10, '<p>Casual and cute, GUESS\' Tutu sandals with bow embellishment are a great way to lift your look.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:11:45'),
(100, 'Women\'s Fine Glass Wedge Sandals', 1, 24, 1, '9', 24.00, '65', '9732', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 15, 1, 10, '<p>A minimalist slingback profile lends effortless sophistication to the Fine Glass sandals from Kenneth Cole New York while a platform heel completes the look with vintage inspiration.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:11:35'),
(101, 'Women\'s Card Wedges', 1, 24, 1, '11', 25.00, '65', '34567', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Braided jute adds espadrille-inspired style to the Card wedges from Kenneth Cole Reaction, an ever-chic T-strap silhouette.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:10:52'),
