(103, 'Brenda Flatform Sport Sandals', 1, 21, 1, '29', 59.00, '25', '454', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 135, 1, 10, '<p>Steve Madden combines lift with sporty fashion in the Brenda sandals, featuring a sturdy wedge and stylish straps.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:10:27'),
(104, 'Memory Foam Rivver Sandals', 1, 28, 1, '11', 35.00, '98', '45498', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 3, 1, 10, '<p>Giani Bernini updates the thong silhouette with a wide strap on these Rivver sandals. Side buckle detail is a classic accent.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:10:17'),
(105, 'Daz Flat Slide Sandals', 1, 1, 1, '22', 51.00, '54', '4598', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 15, 1, 10, '<p>Minimalist-chic style is simple with DKNY\'s Daz sandals finished with a subtle wedge heel and glints of gleaming logo accents.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:10:06'),
(106, 'Maisie Stitch Mules', 1, 24, 1, '35', 70.00, '98', '4153', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>The Kenneth Cole New York Maisie Stitch Mule is a two band block heel mule.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:09:56'),
(107, 'Women\'s Fuzz Slippers', 1, 21, 1, '15', 36.00, '44', '3354', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 2, 17, 1, 15, '<p>Clad in fluffy faux-fur, Steve Madden\'s Fuzz slippers slip-on in plush, cozy fashion with a striped slingback strap for a secure fit.</p>', 2, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:09:47'),
(108, 'Dacey Mule Pump', 1, 1, 1, '12', 39.00, '59', '5842', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 2, 1, 10, '<p>A clearly cool look with a see-through inset front and center, DKNY\'s Dacey mules bring stylish edge to any look.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:09:39'),
(109, 'Grandie Slip-On Tailored Mules', 1, 111, 1, '10', 50.00, '32', '4819', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 17, 1, 10, '<p>Madden Girl\'s Grandie mules are tailored in menswear-inspired fashion with a sleek pointed toe and handsome slip-on profile.</p>\n<p>Pointed-toe slip-on mule flats</p>\n<p>Manmade upper; manmade lining; manmade sole</p>\n<p>Imported</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:08:52'),
(110, 'Collection Women\'s Delana Amber Clogs', 1, 23, 1, '25', 63.00, '51', '74520', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Clarks Collection dresses up a classic clog in the ornamental strap and hardware details of these Delana Amber mules for a go-to look with all-day wear.</p>\n<p>Round-toe slip-on mules</p>\n<p>Cushion Soft&trade; padding with an OrthoLite&reg; footbed for added comfort</p>\n<p>Strap and hardware details</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:08:39');
