(111, 'Raquel Women\'s Jr Trapper Slipper', 1, 29, 1, '15', 39.00, '56', '8564', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 18, 1, 120, '<p>Seriously comfy. Take relaxation to a new level in theHush Puppies raquel JR trapper. Crafted with soft suede, our moccasin slippers are lined with an ultra-cozy pile that will keep your feet so warm and comfy you\'ll never want to take them off.</p>\n<p>Plush pile lining</p>\n<p>Soft suede upper</p>\n<p>Fit runs true to size</p>\n<p>Flat</p>\n<p>Slip-on moccasin slipper</p>\n<p>Whipstitch detail on toe with rawhide lacing</p>\n<p>Padded insole and flexible lightweight rubber sole</p>\n<p>Available in medium width M</p>\n<p>Cow suede upper, manmade lining, rubber sole</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:08:26'),
(112, 'Ricki Espadrille Flatform Mules', 1, 1, 1, '20', 49.00, '15', '87432', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 5, 13, 1, 15, '<p>Zig-zag quilting and a plaited espadrille platform lend fresh dimension to the fun Ricki mules by DKNY.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:08:14'),
(113, 'Women\'s Moise Margaret Mules', 1, 8, 1, '33', 95.00, '21', '1655', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 10, 14, 1, 10, '<p>Backless beauties with sleek lines up front, Calvin Klein\'s Moise Margaret mules complete skinny pants or cuffed trouser looks.</p>\n<p>&nbsp;</p>', 10, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:07:58'),
(114, 'Women\'s Wallice Mules', 1, 24, 1, '21', 55.00, '47', '4521', 1, 1, '2020-07-20 00:00:00', 0, 1, 2, 1, 17, 1, 10, '<p>Kenneth Cole New York\'s Wallice mules mix irresistible texture with menswear-inspired tailoring for a handsome accent that dresses up or down with effortless fashion.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:07:48'),
(115, 'Cloudstepper Women\'s Step Flow Low Clogs', 1, 23, 1, '20', 48.00, '65', '45451', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Step Flow Low, women\'s shoes, &ndash; This Cloudsteppers&trade; slipper features a cozy felt upper and a lighter-than-air weight. Its breathable OrthoLite&reg; footbed wicks away moisture.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:07:39'),
(116, 'Women\'s Gills Slip-On Sneakers', 1, 23, 1, '20', 48.75, '35', '415454', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 13, 1, 10, '<p>Step Flow Low, women\'s shoes, &ndash; This Cloudsteppers&trade; slipper features a cozy felt upper and a lighter-than-air weight. Its breathable OrthoLite&reg; footbed wicks away moisture.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:07:30'),
(117, 'Ali Mule Flats', 1, 1, 1, '12', 55.00, '12', '5326', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 3, 1, 10, '<p>Patterned to perfection, Steve Madden\'s Gills slip-on sneakers step out in sporty style.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:07:18'),
(118, 'Ramona Women\'s Bootie Slipper', 1, 29, 1, '20', 47.00, '65', '49562', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Cozy feet-happy feet. Cozy warmth for a never-taking-off feel in the Hush Puppies ramona bootie. Easy to slip on with comfortable pile lining and durable rubber sole. Be ready for relaxation at a moment\'s notice.</p>\n<p><br />Whipstitch details at toe, faux fur collar, rawhide lace. Plush pile lining.&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:07:08'),
(119, 'Women\'s Oh Yeah Slides', 1, 30, 1, '19', 99.00, '54', '8745', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 13, 1, 10, '<p>A cozy slipper? Oh Yeah. A cute slide? Oh Yeah. These plush UGG&reg; hybrids work inside and play outside as fun statement shoes.</p>\n<p>1-1/2\" heel</p>\n<p>Round-toe slip-on slides</p>\n<p>Elastic strap with UGG&reg; graphic</p>\n<p>This product was made in a factory that supports women in our supply chain with the help of HERproject, a collaborative initiative that creates partnerships with brands like ours to empower and educate women in the workplace</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:06:59'),
(120, 'Collection Women\'s Leisa Clover Mules', 1, 23, 1, '26', 62.00, '46', '6571', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 2, 1, 10, '<p>This full grain leather mule has an airy EVA outsole. An elastic gore eases its slip-on fit, and its Ultimate Comfort benefits include an Ortholite footbed.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:06:50'),
(121, 'Julia Camo Phone Crossbody', 1, 5, 1, '25', 68.00, '154', '4654', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Tommy Hilfiger\'s Phone crossbody holds your tech securely, while a crossbody strap adds undeniable convenience.</p>\n<p>Silhouette is based off 5\'9\" model</p>\n<p>23-5/8\"L adjustable strap</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:06:25'),
(122, 'Boho Studded Strap Hobo', 1, 21, 1, '24', 64.00, '15', '78451', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 15, 1, 10, '<p>When you\'re on the go, the Steve Madden Boho Studded Strap Small Hobo will become your new best friend. Grab hold of the easygoing silhouette for a day around town, or night out in style.</p>\n<p>Silhouette is based off 5\'9\" model</p>\n<p>8\"L removable, adjustable strap</p>\n<p>Magnetic snap closure</p>\n<p>Silver-tone exterior hardware &amp; side slip pockets</p>\n<p>1 interior center zip compartment, 1 zip pocket &amp; 2 slip pockets</p>\n<p>Fits an iPhone &amp; iPad</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:06:17'),
(123, 'Signature Card Holder', 1, 7, 1, '11', 0.00, 'NULL', '7452', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 11, 1, 10, '<p>A signature print and a gleaming logo detail heighten the upscale appeal of this compact card holder from MICHAEL Michael Kors.</p>\n<p><br />Gold-tone exterior hardware, logo &amp; 4 credit card slots</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:06:09'),
(124, 'Daily Diaper Bag', 1, 31, 1, '53', 298.00, '64', '48545', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 14, 1, 10, '<p>kate spade new york Daily Large Diaper Bag</p>\n<p>Gold-tone hardware; footed bottom</p>\n<p>11\" handles</p>\n<p>3 exterior slip pockets</p>\n<p>1 interior zip pocket, 3 slip pockets, removable pouch and changing mat</p>\n<p>This item purchased online must be returned to the vendor by mail only.&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:05:59'),
(125, 'Amelia Nylon Flap Backpack', 1, 5, 1, '55', 138.00, '15', '1552', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 1, 1, 10, '<p>Make a cool quilted statement while on the go with Tommy Hilfiger\'s Amelia Nylon Flap backpack. Now that\'s what we call effortless chic!</p>\n<p>WHY YOU\'LL LOVE IT: a nylon bag is your go-to bag, ready for any day, any weather. It\'s lightweight, durable and water-resistant!</p>\n<p>Silhouette is based off 5\'9\" model</p>\n<p>2\"L handles; 27\" straps</p>\n<p>Magnetic snap closure</p>\n<p>Gold-tone exterior hardware</p>\n<p>1 interior slip pocket, 1 zip pocket</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:05:48'),
(126, 'Softy Leather All In One Wallet', 1, 28, 1, '20', 59.00, '45', '435345', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Giani Bernini\'s All-In-One Softy wallet organizes your essentials and complements any handbag, in soft leather.</p>\n<p>Snap tab closure at front; zip closure at back compartment, 1 slip pocket on back</p>\n<p>Zipper compartment features 1 zipper divider pocket, 2 slips pockets; can fit an iPhone 8 Plus</p>\n<p>Topstitch details</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:05:37'),
(127, 'Lynne Convertible Crossbody', 1, 32, 1, '20', 55.00, '21', '46514', 1, 1, '2020-07-21 00:00:00', 0, 1, 3, 1, 16, 1, 10, '<p>The Kipling Lynne bag has a unique design that can be converted and worn 3 ways: crossbody, fanny pack or wristlet.</p>\n<p>Top zip &amp; magnetic snap closures</p>\n<p>Silver-tone exterior hardware &amp; monkey key fob</p>\n<p>1 interior zip pocket &amp; 6 credit card slots</p>\n<p>Bag converts from crossbody to waistpack or wristlet style</p>\n<p>The Belt Bag featured on The It List</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:05:18'),
(128, 'Elissa Graffiti Logo Pebble Leather Charm Crossbody', 1, 1, 1, '35', 0.00, 'NULL', '5424', 1, 1, '2020-07-21 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>A designer charm pops and shines on a DKNY mini crossbody sized to organize going-out essentials, from credit cards to lipstick to smartphone.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:05:10'),
(129, 'Tabby Leather Shoulder Bag 26', 1, 27, 1, '99', 350.00, '65', '52165', 1, 1, '2020-07-21 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Add a touch of whimsy to your everyday look with this structured shoulder bag from COACH.</p>\n<p>Small sized bag; 10-1/2\"W x 6\"H x 3\"D (width is measured across the bottom of handbag)</p>\n<p>Gold-tone exterior hardware &amp; 1 slip pocket</p>\n<p>1 interior zip pocket &amp; multifunction pocket</p>\n<p>Scarf and charm not included</p>\n<p>6-3/4\"L detachable strap; 21-1/4\"L detachable strap</p>\n<p>Silhouette is based off 5\'9\" model</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:05:02'),
(130, 'College Green Medium Phone Crossbody', 1, 33, 1, '15', 0.00, 'NULL', '9545', 1, 1, '2020-07-21 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Keep your phone, cards and other essentials all in one handy place with our new cross body style. Great for keeping it light on the go, this design is perfect for keeping by your side while on the move. Your summer styles are sorted with our College Green collection! Perfect for adding practicality to casual or formal ensembles alike, we\'ve made it easy to look stylish whatever the occasion.</p>\n<p>26\"L strap</p>\n<p>Flapover with popper fastening closure</p>\n<p>Brushed light gold-tone exterior hardware, 1 slip pocket &amp; 1 zip pocket under flap</p>\n<p>6 interior credit card slots, 1 zip pocket &amp; 1 slip pocket; its iPhone XS Max or smaller model</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 13:04:51'),
