(160, 'Sunglasses, VA4065 53', 1, 49, 1, '69', 0.00, 'NULL', '2421', 1, 1, '2020-07-21 00:00:00', 0, 1, 3, 1, 13, 1, 10, '<p>One of the most storied high-end fashion brands in the world, Valentino embodies effortless elegance, craftsmanship and modern couture. Known for an unconventional idea of femininity, Valentino presents a dichotomy of fragile yet dangerous nature mixed with an element of uniqueness and distinction.</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:59:16'),
(161, 'Sunglasses, PR 60XS 59', 1, 50, 1, '59', 378.00, '56', '1269', 1, 1, '2020-07-21 00:00:00', 0, 1, 3, 1, 47, 1, 10, '<p>The hallmark styling of this world-renowned fashion leader denotes high quality with a dedication to innovation and a strong tradition of craftsmanship. Prada is synonymous with an understated style that has always anticipated, and often dictated, new trends. Prada sunglasses use only the finest materials to strike the ideal balance of form and function.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:59:03'),
