(165, 'Women\'s Sunglasses', 1, 53, 1, '154', 351.00, '55', '79832', 1, 1, '2020-07-22 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>The Giorgio Armani collection came into being in 1975, when the designer rewrote the rules for menswear, revolutionizing proportions and aiming at an unheard of fluidity and elegance. Since then, the line has never ceased to evolve, with continual research into an aesthetic based on essential, never ostentatious, style as its outstanding trait. Elegant, modern and sophisticated, the Giorgio Armani collection stands out for the excellence of its manufacture, the extreme attention to detail, the purity of the lines and the use of high quality materials.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:58:27'),
