(256, 'Heavenly Luxe Complexion Perfection Makeup Brush #7', 1, 79, 1, '16', 40.00, '23', '6094', 1, 1, '2020-07-24 00:00:00', 0, 1, 3, 1, 69, 1, 10, '<p>This award-winning, best-selling 2-in-1 brush is so easy to use, it does the work for you to flawlessly apply your favorite foundations and concealers evenly and smoothly. Featuring ultra-plush Heavenly Luxe hairs that won\'t shed, plus precision-cut brush heads, this dual-ended brush gives you perfectly streak-free coverage. With two different brush sizes in one, you can efficiently apply your makeup to cover large areas, while easily blending hard-to-reach crevices for your most airbrushed results every time!</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:34:29'),
(257, 'Double Wear Light Soft Matte Hydra Makeup, 1-oz.', 1, 80, 1, '20', 43.00, '61', '30514', 1, 1, '2020-07-24 00:00:00', 0, 1, 3, 1, 93, 1, 20, '<p>Matte has a fresh new attitude. Double Wear Light is matte re-imagined. Softly diffused. Always selfie ready. Super-long 24-hour wear. Fresh. Natural. Matte. Available in cool, neutral and warm undertones.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:34:19'),
(258, '224S Tapered Blending Brush', 1, 81, 1, '15', 32.00, '2680', '6569', 1, 1, '2020-07-24 00:00:00', 0, 1, 3, 1, 29, 1, 20, '<p>This brush from MAC has soft fibers that taper to form a medium-size dome shape for the sheer application and blending of eye shadow, especially in the contour of the eye.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:34:09'),
(259, 'Wispies, 5-Pk.', 1, 82, 1, '4', 9.00, '50', '31205', 1, 1, '2020-07-24 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>Your flutter is in full effect with the bold and sexy Wispies! With long hair fiber lengths and flared lash style, you can achieve fearlessly bold party looks in a snap.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:33:56'),
(260, 'Definicils Lengthening and Defining Lengthening and Volume Mascara, 0.21 oz.', 1, 83, 1, '15', 27.50, '65', '3418', 1, 1, '0000-00-00 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>For lavishly long, perfectly defined lashes, this iconic award-winning Lanc&ocirc;me mascara provides the ultimate in separation. The smudge-proof mascara is designed with carefully selected polymers that coat each lash from root to tip, to help lengthen and outline each lash for unmatched definition.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:31:02'),
(261, 'They\'re Real! Lengthening Mascara', 1, 84, 1, '10', 25.00, '33', '1576', 1, 1, '2020-07-24 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>They\'re real! Mascara lengthens, curls, volumizes, lifts &amp; separates. This long-wearing formula won\'t smudge or dry out and comes with a specially designed brush that reveals lashes you never knew you had!</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:30:44'),
(262, 'ClÃ© de Peau BeautÃ© Concealer SPF 25', 1, 85, 1, '25', 0.00, 'NULL', '64512', 1, 1, '2020-07-24 00:00:00', 0, 1, 3, 1, 19, 1, 20, '<p>Cl&eacute; de Peau Concealer helps deliver long-lasting, full coverage while correcting the appearance of dark circles, spots, imperfections and uneven tone without a heavy finish. The 16-time InStyle Best Beauty Award Winner is now formulated with SPF 25 to help provide sun protection throughout the day. It helps leave skin looking smooth and refined with a seamless finish while protecting against UV rays.</p>\n<p>&nbsp;</p>', 2, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:30:32'),
(263, 'RE:SET Liquid Matte Foundation', 1, 86, 1, '2', 10.00, '35', '2564', 1, 1, '2020-07-24 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>This complexion-perfecting liquid foundation offers seamless coverage, comfortable long wear and a striking matte finish. Formulated with a double-dose of pigments, RE:SET Liquid Matte delivers instant coverage to help hide all skin imperfections. Plus, an exclusive antioxidant blend helps to nourish, soothe and protect skin from environmental aggressors.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:30:21'),
(264, 'Sculpting Pencil', 1, 87, 1, '5', 13.00, '25', '5156', 1, 1, '2020-07-24 00:00:00', 0, 1, 3, 1, 18, 1, 5, '<p>Calling all contour queens! These easy-to-use cream Sculpting Pencils offer long-lasting makeup coverage in tones that are ideal for both highlighting and contouring. Each face sculpting makeup pencil is dual-ended and comes with a lighter shade for highlighting on one end and a deeper shade for contouring on the other. With a matte color finish, the Nudies Sculpting Pencil provides an effortless way to define your finest features and get a naturally sculpted look. With four dual-ended pencils that each feature two complementing shades, there\'s an option for every skin tone!</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:30:06'),
(265, 'All + Nothing Concealer', 1, 88, 1, '4', 10.00, '125', '49151', 1, 1, '2020-07-24 00:00:00', 0, 1, 3, 1, 10, 1, 5, '<p>This portable and easy-to-use twist-up concealer stick is the perfect secret weapon to help conceal, brighten and sculpt at home or on the go for a seamless matte finish.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:29:50'),
(266, 'Addict Lip Maximizer Plumping Gloss', 1, 89, 1, '10', 0.00, 'NULL', '5491', 1, 1, '2020-07-24 00:00:00', 0, 1, 3, 1, 69, 1, 5, '<p>The signature lip plumping gloss from the house of Dior helps provide a plumping lip care for absolute comfort, shine and a volume-maximizing effect.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:29:41'),
(267, 'Lip Pencil', 1, 81, 1, '12', 34.00, '50', '14511', 1, 1, '2020-07-24 00:00:00', 0, 1, 3, 1, 18, 1, 5, '<p class=\" c-m-v-1\" data-auto=\"product-description\">A pencil designed for shaping, lining or filling in the lip. Lip Pencils have a smooth, creamy texture that is perfect for lining the lips or filling them in. They are long-lasting and available in a wide selection of colours that each work well with many different lipstick shades. The colour of Lip Pencils is protected by Vitamin E, which acts as an anti-oxidant, and they contain emollients that moisturize the lips. Lip Pencils can be worn alone, with Lipstick, or Lipglass.</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:02:34'),
(268, 'Teyana Taylor Lipstick', 1, 81, 1, '6', 20.00, '21', '5121', 1, 1, '2020-07-24 00:00:00', 0, 1, 3, 1, 1, 1, 5, '<p>MAC Lipstick, the iconic product that made MAC famous. Now in four limited-edition shades and two textures that work on every skin tone for the MAC Teyana Taylor Collection. An old-school classic given Teyana\'s personal spin with a brand-new, \'90s-neon beat.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:02:26'),
(269, 'Eye Color Quad', 1, 90, 1, '20', 88.00, '21', '3143', 1, 1, '2020-07-24 00:00:00', 0, 1, 3, 1, 1, 1, 5, '<p>Long-wearing. Multi-dimensional. Ultra-pigmented an eye shadow quad is designed with four opulent complement shades that achieve multiple looks, from a bold, smoky eye, to a sexy slash of color and everything in between. Formulated with advanced color processes, the four luxurious finishes&mdash;sheer sparkle, satin, shimmer and matte&mdash;offer a spectrum of intensity and effects and deliver incredible shade fidelity and outstanding adhesion. \"Eyes are the most effective way to create character, to reflect your personality and make a true statement with your look.\" &ndash; Tom Ford</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:02:15'),
(270, 'Naked Ultraviolet Eyeshadow Palette', 1, 91, 1, '20', 49.00, '49', '4652', 1, 1, '2020-07-24 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>An eyeshadow palette with 12 purple and neutral eyeshadows in matte, shimmer and glitter eyeshadow finishes alongside a holographic pearl transformer.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:02:05'),
(271, 'COCO MADEMOISELLE Eau de Parfum Fragrance Collection', 1, 92, 1, '20', 0.00, 'NULL', '4654', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 36, 1, 25, '<p class=\" c-m-v-1\" data-auto=\"product-description\">This fresh, citrusy oriental scent is enlivened with a sexy, modern kick that recalls the irrepressible spirit of Mlle Coco Chanel.</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:01:51'),
(272, 'Si Passione Eau de Parfum 4-Pc Gift Set', 1, 53, 1, '45', 138.00, '4', '1598', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 2, 1, 10, '<p>Discover Giorgio Armani\'s feminine fragrance, Si Passione. This sparkling, fruity floral scent with notes of rose &amp; woody vanilla was created fro the woman who is passionate, feminine, and free. Say yes to your passion. This Mother\'s Day, gift your mother the confidence to say Si to her passion.</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:01:41'),
(273, 'Bloom Ambrosia di Fiori Eau de Parfum Intense, 1.6-oz.', 1, 52, 1, '50', 0.00, 'NULL', '1669', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 10, 1, 5, '<p>Created by Alessandro Michele, the Gucci Bloom scents are inspired by the idea of absolute authenticity, the freedom to be who you are. The new fragrance Gucci Bloom Ambrosia di Fiori invites those who wear it to celebrate their true selves and the emotions they feel. Matching this expression, the perfume is deepened in a refined Eau de Parfum Intense. An imaginary garden redolent of flowers and plants in diverse types and colors, the original Gucci Bloom scent is the foundation of Gucci Bloom Ambrosia di Fiori. In the intensified take on this scent, the vibrant bouquet features new ingredients, including the rare and tenacious velvety orris, the root of iris. The other new note, Damascena rose is distilled from the most fragrant breed of rose, harvested in the early morning to give the powerful rendition of the flower. Instead of a classical pyramid construction of top, heart and base notes, Gucci Bloom opens fully at once with noble and rare flowers: jasmine bud extract, tuberose, Rangoon creeper, Damascena rose and velvety orris.</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:01:33'),
(274, 'Miss Dior Absolutely Blooming Eau de Parfum Roller-Pearl, 0.67-oz.', 1, 89, 1, '19', 0.00, 'NULL', '6296', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 2, 1, 15, '<p>Bright and colorful, a floral delight you return to over and over. Top notes of tangy Red Berry are joyful and striking. At the heart of this perfume, a sublime duet of Grasse Rose and Damascus Rose embraces sensuous Peony. This abundance of fresh flowers is enveloped in a base of white musk notes.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:01:25'),
(275, 'Women Eau de Parfum Spray, 1.7-oz.', 1, 8, 1, '40', 0.00, 'NULL', '32419', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 18, 1, 10, '<p>The first fragrance ever created by Raf Simons, Calvin Klein WOMEN denotes not one, but many-a group of individuals, each with their own distinct voice. Drawing inspiration from the beautiful strength and delicate tenderness of the female experience, this fragrance celebrates the feminine spirit in all its forms. A light pink hue composed of gentle and vulnerable ingredients. Delicate orange flower petals layered with fresh eucalyptus acorns open to reveal a rich heart of Alaskan cedarwood. Calvin Klein WOMEN is a tribute to the contrasts with femininity. Infinitely varied and deeply complex, like the personas of the women who inspire it. The female eye artwork featured on the bottle, created by artist Anne Collier, represents an iconic emblem of the #IAMWOMEN campaign and serves as a source of strength and emotion.</p>\n<p>A woody floral</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:01:17'),
(276, 'Cashmere Mist Fragrance Collection', 1, 93, 1, '35', 0.00, 'NULL', '6087', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 17, 1, 6, '<p>A fragrance to seduce the senses. The sheer floral scent of Cashmere Mist combines essences of Moroccan jasmine, lily of the valley and bergamot with warm undertones of sandalwood, amber and musk. Because nothing feels like cashmere against the skin.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:01:09'),
(277, '3-Pc. Rever de Moi Dream Eau de Parfum Gift Set', 1, 94, 1, '69', 130.00, '35', '1952', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 15, 1, 10, '<p>Dream: Of beautiful skies And the delicate scent of Sweet dreams. Let your senses become entranced by a floral fruity fragrance, balanced by a floral note of delicate peony and muguet, softened with sheer musk. Find yourself in a dream state, floating in pure bliss.</p>\n<p>GIFT SET INCLUDES:</p>\n<p>Eau de Parfum, 3.4-oz.</p>\n<p>Body Lotion, 6.8-oz.</p>\n<p>Eau de Parfum, 0.34-oz.</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:01:00'),
(278, 'Mon Paris Eau de Parfum Spray, 1.6-oz', 1, 95, 1, '35', 100.00, '21', '3519', 0, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 20, 1, 5, '<p>Yves Saint Laurent Beaut&eacute; introduces Mon Paris Eau de Parfum, a passionate perfume for women inspired by Paris - the city of love. Sweet notes of red berries are softened by a heart of datura flower and anchored by a base of white musk for a woman\'s fragrance that is romantic in every way.</p>\n<p>Top Notes: Red Berries</p>\n<p>Middle Notes: White datura flower</p>\n<p>Base Notes: White musk</p>\n<p>How to Use: Spray your Yves Saint Laurent parfum on pulse points; wrists, neck, d&eacute;colletage, wherever you feel a heartbeat.</p>', 2, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:00:51'),
(279, 'Sexy Blossom Eau de Parfum Spray, 3.4 oz.', 1, 7, 1, '112', 112.00, '50', '4558', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 17, 1, 10, '<p>A fragrance born of the essence of spring&mdash;enchanting, flirtatious and romantic&mdash;Michael Kors Sexy Blossom is a floral woody musk scent with a sensual heart of beguiling blooms.</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:00:43'),
(280, '3-Pc. J\'adore Eau de Parfum Gift Set', 1, 89, 1, '50', 149.00, '55', '3150', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 18, 1, 15, '<p>Give Mom her favorite fragrance in a beautiful gold and pink gift box.</p>\n<p>GIFT SET INCLUDES:</p>\n<p>J\'adore Eau de Parfum Spray, 3.4-oz.</p>\n<p>J\'adore Beautifying Body Milk, 2.5-oz.</p>\n<p>J\'adore Eau de Parfum Miniature, 0.17-oz.</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:00:34'),
(281, 'Eau de Parfum Spray, 3.3 oz.', 1, 96, 1, '55', 118.00, '21', '41654', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 18, 1, 15, '<p>Imagine femininity, luxury and style- bottled. Introducing Jimmy Choo, the fragrance. Expressing an aura of strength and beauty, glamour and confidence, it is inspired by modern women. Luminous green top notes, a heart of rich and exotic tiger orchid and lingering sensual base notes of sweet toffee and Indonesian patchouli leave a sensual memory on the skin. Experience Jimmy Choo with this 3.3 oz Eau de Parfum Spray.</p>\n<p>Top Notes: Mandarin Oranges, Pear, Green Notes</p>\n<p>Heart Note: Orchid Base</p>\n<p>Base Notes: Patchouli, Toffee</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:00:23'),
(282, 'Candy Gloss Eau de Toilette Spray, 1-oz.', 1, 50, 1, '25', 64.00, '21', '35195', 1, 1, '2020-07-27 00:00:00', 1, 1, 3, 1, 18, 1, 10, '<p>Discover Candy Gloss, the feminine fragrance from Prada. Blended by Daniela Andrier under the creative direction of Miuccia, Prada Candy Gloss is a sensual sorbet, sweet as cherry and solar as the orange blossom. Juicy, sparkling and intensely joyful. Prada Candy fragrances are delightfully addictive scents inspired by the sweetest, most gourmand facets of the Prada woman.</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:00:13'),
(283, '3-Pc. Flowerbomb Mother\'s Day Gift Set', 1, 97, 1, '165', 165.00, '49', '12652', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 133, 1, 10, '<p>Give Mom the gift of opulence and luxury she deserves with this three-piece Flowerbomb gift set adorned with an oversized silk flower inspired by Viktor &amp; Rolf\'s haute couture fashion</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 12:00:02'),
(284, 'Good Girl Eau de Parfum Spray, 1 oz.', 1, 98, 1, '15', 69.00, '55', '3492', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 1, 1, 15, '<p>Black and White... Good Girl, Bad Girl. Good Girl is a sensual, evocative fragrance born of the beautiful contradictions and the ever-present duality of modern women and modern life. Both freshly light and moodily dark, this innovative fragrance captures a woman\'s wondrous complexity with surprising and exceptional ingredients. The sweet, alluring qualities of jasmine give Good Girl its brightness and femininity. The darker side of Good Girl is created with richly fragrant cocoa and intoxicating tonka. Almond and coffee bring Good Girl its immediate vibrancy. Tuberose, extracted in a new way that creates a rich delicacy, is the fragrance\'s wild card, bringing fluidity and femininity. Good Girl exemplifies the effortless elegance and wit of the House of Herrera. Rarely do fragrance bottles make the potent emotional statement that the groundbreaking Good Girl bottle does. A glass fla&ccedil;on of a very high-heeled shoe, it speaks as eloquently of the power of modern femininity and a woman\'s dual nature as the fragrance itself. Made of sleek, smoky midnight blue glass, the Good Girl stiletto bottle stands on the tallest, thinnest gold-tone heel. An unexpected, highly innovative fragrance in a bottle as memorable and emotionally engaging as the fragrance itself, Good Girl captures the spirit and imagination of a modern powerful woman.</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 11:58:20'),
(285, 'euphoria Rollerball, .33 oz', 1, 8, 1, '20', 0.00, 'NULL', '3169', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 16, 1, 10, '<p>One of the world\'s leading lifestyle brands, Calvin Klein is synonymous with authentic modern minimalist style. Everything it creates &mdash;clothing, accessories, home design&mdash;becomes a timeless classic. The label\'s award-winning fragrances are no exception. Calvin Klein\'s portfolio of bold and iconic scents continues to redefine the world of perfume. Free the fantasy: embark on a journey without limits, sparked by a new found freedom of modern sensuality. Provocative and sensual, euphoria is inspired by the orchid\'s mythical, sexy and exotic notes, creating a truly mysterious and feminine fragrance. Intensely luxurious, euphoria eau de parfum spray lasts for hours and garners compliments day and night. The top opens with a burst of pomegranate and succulent persimmon followed by a mysterious and intoxicating blend of rich orchid and dewy lotus blossom. The drydown leaves a lasting signature of liquid amber and mahogany wood paired with sensual musks and an addictive cream accord.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 11:58:12'),
(286, '3-Pc. Power Starters Anti-Wrinkle Set', 1, 99, 1, '25', 89.00, '26', '1626', 1, 1, '2020-07-27 00:00:00', 1, 1, 3, 1, 13, 1, 10, '<p>Get started with this trio of wrinkle fighters from StriVectin for youthful, healthy-looking skin.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 11:57:58'),
(287, 'Essentials Perfect Cleansing Oil, 10.1 oz', 1, 100, 1, '15', 50.00, '612', '9151', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 17, 1, 10, '<p>Your essential cleansing oil. Double cleansing is the Asian Beauty Secret to healthy, beautiful-looking clean skin. This comfortable, lightweight cleansing oil rapidly reaches deep down into pores to thoroughly remove dirt and makeup. Quickly lifts base makeup and waterproof eye makeup that are tough for other cleansers to remove.</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 11:57:48'),
(288, 'Absolue Premium Bx Hand SPF 15 Sunscreen, 3.4 Oz', 1, 83, 1, '15', 50.00, '269', '9532', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 17, 1, 5, '<p>A luxurious and comprehensive hand treatment that addresses the special needs of mature hands. Diminishes and discourages the appearance of age spots, while replenishing and protecting the skin. RESULT: Immediately, skin on hands is hydrated, soft and luminous. With continued use, skin becomes more uniform, looks firmer and youthful.Massage into hands and cuticles as needed.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 11:57:33'),
(289, 'Dramatically Different Moisturizing Lotion+ with Pump, 4.2 oz', 1, 101, 1, '10', 28.00, '165', '9242', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 69, 1, 6, '<p>Step 3 in Clinique\'s customized 3-Step Skin Care System. Dermatologist-developed face moisturizer softens, smooths, improves. Leaves skin glowing. The secret\'s in the system. Clinique\'s revolutionary 3-Step Skin Care System was created by a celebrated dermatologist. It\'s simple, customized and takes just three minutes, twice a day: cleanse with Facial Soap, exfoliate with Clarifying Lotion, moisturize with Dramatically Different Moisturizing Lotion+, oil-free Gel or lightweight Jelly.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 11:57:23'),
(290, 'Checks and Balances Frothy Face Wash, 5-oz.', 1, 102, 1, '10', 24.00, '55', '2615', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 13, 1, 10, '<p>Checks and Balances&trade; Frothy Face Wash, Origins number one foaming face wash lathers up and gently cleanses as it balances both dry and oily areas for skin that feels comfortably clean and refreshed.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 11:56:55'),
(291, 'Mini Facial Toning Device', 1, 103, 1, '50', 199.00, '25', '9215', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 13, 1, 5, '<p>The NuFACE mini is a petite, portable microcurrent facial toning device that is FDA-cleared for facial stimulation. The mini gently stimulates the larger surface areas of the face to improve your appearance to provide a 5 minute facial-lift. Compact and convenient, it\'s the perfect starter kit or for travel on-the-go. Clinically-tested for improved facial contour, skin tone and reduced wrinkles in as little as 5 minutes a day.</p>\n<p>In a recent clinical study:</p>\n<p>85% of clinical study users experienced significant improvements in facial contour</p>\n<p>80% of clinical study users said their face felt more toned</p>\n<p>73% of clinical study users experienced significant improvements in skin tone</p>\n<p>&nbsp;</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 11:56:42'),
(292, 'Clarifying Lotion - Skin Type 2, 13.5 oz', 1, 101, 1, '10', 27.00, '59', '9245', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 17, 1, 5, '<p>Step 2 in our customized 3-Step Skin Care System. Dermatologist-developed liquid exfoliating lotion clears the way for smoother, brighter skin. The secret\'s in the system. Our revolutionary 3-Step Skin Care System was created by a celebrated dermatologist. It\'s simple, customized and takes just three minutes, twice a day: cleanse with Facial Soap, exfoliate with Clarifying Lotion, moisturize with Dramatically Different Moisturizing Lotion+.</p>\n<p>Sweeps away pollution, grime, dulling flakes to reveal smoother, clearer skin.</p>\n<p>Preps skin for moisturizer.</p>\n<p>Helps remove surface flakes that can be a barrier to moisture absorption. Even helps fine dry lines disappear.</p>\n<p>Allergy Tested. 100% Fragrance Free. Dermatologist Developed. Oil-Free. Paraben Free. Phthalate Free. Sulfate Free. SLS Free. Silicone Free. Gluten Free.</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 11:56:35'),
(293, 'Bienfait Multi-Vital SPF 30 Day Cream Moisturizer and Sunblock, 1.7 oz.', 1, 83, 1, '20', 52.00, '21', '54265', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 1, 1, 10, '<p>A unique daily SPF moisturizer for all skin types including sensitive skin, enriched with Vitamin E, Vitamin CG and Vitamin B5. This nourishing moisturizer provides sun protection and 24-hours of hydration.</p>\n<p>WHAT IT DOES:</p>\n<p>A sunblock face cream that leaves skin feeling hydrated and smooth.</p>\n<p>This skin moisturizer helps combat fine lines, dark spots and wrinkles while protecting the skin from sun damage and delivering improvements to the overall texture of the skin.</p>\n<p>RESEARCH RESULTS:</p>\n<p>Containing antioxidants, Vitamin E, Vitamin CG and Vitamin B5, this is the best daily moisturizer with SPF to fight visible effects of environmental aggressors.</p>\n<p>Offers protection from sun damage with dermatologist recommended broad spectrum (UVA-UVB radiation) SPF 30 protection.</p>\n<p>Non-comedogenic face moisturizer for dry and sensitive skin.</p>\n<p>Skin is hydrated, looks its healthy best, and feels touchably soft all day.</p>\n<p>With Broad Spectrum SPF 30 sunscreen and essential antioxidant protection, Bienfait Multi-Vital gives your skin what it needs to help fight the visible effects of environmental skin damage.</p>\n<p>Recommended by the Skin Cancer Foundation.</p>\n<p>HOW TO USE:</p>\n<p>For best results, apply the day cream during morning skin care routine after skin is cleansed and dried.</p>\n<p>Smooth the sunscreen lotion onto face and neck area.</p>\n<p>SKIN TYPES:</p>\n<p>Suitable for all skin types.</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 10:23:33'),
(294, 'Double Serum Complete Age Control Concentrate, 1.6-oz.', 1, 104, 1, '30', 126.00, '61', '1453', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 1, 1, 10, '<p>Clarins #1 bestselling anti-aging serum is an innovative 2-in-1 formula packed with 21 potent plant extracts - including Turmeric - to effectively target lines and wrinkles, even out skin tone and boost radiance in just 7 days.* Results: - Visibly reduces wrinkles - Promotes skin firmness - Revives radiance - Hydrates and smoothes - Visibily tightens pores *Satisfaction test - 362 women - 7 days. This award winning formula with 1 bottle of Double Serum is sold every 5 seconds around the world.** **Based on Clarins\' internal data Jan-Dec 2019</p>\n<p>For all ages, all ethnicities, all skin types, even the most sensitive</p>\n<p>Key ingredients include:</p>\n<p>Turmeric, distinguished for its exceptional anti-aging properties</p>\n<p>Teasel Extract, delivers revitalizing and antioxidant benefits</p>\n<p>Organic Green Banana, plays a key role in promoting firm-looking skin</p>\n<p>Myrothamnus, visibly smoothes, tones, and de-stresses</p>\n<p>Red Jania, promotes an even complexion</p>\n<p>Organic Goji Berry, revitalizes and tones</p>\n<p>Noncomedogenic</p>\n<p>Mineral Oil Free</p>\n<p>Paraben-Free</p>\n<p>Sulfate-Free</p>\n<p>Phthalate-Free</p>\n<p>Silicone-Free</p>\n<p>How to use:</p>\n<p>Turn the dial to customize dosage for your skin\'s needs, and press the pump</p>\n<p>Mix both phases in the palm of your hand</p>\n<p>Apply morning and/or evening to clean face and neck</p>\n<p>Follow with your regular skin care</p>\n<p>88% visibly smoother skin*</p>\n<p>83% more radiant skin*</p>\n<p>74% visibly firmer skin*</p>\n<p>*Based on a 7-day satisfaction test of 362 women</p>\n<p>Results:</p>\n<p>Visibly reduces wrinkles</p>\n<p>Promotes skin firmness</p>\n<p>Revives radiance</p>\n<p>Hydrates and smoothes</p>\n<p>Visibly tightens pores</p>\n<p>This award winning formula with 1 bottle of Double Serum is sold every 5 seconds around the world.**</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 10:23:25');
INSERT INTO `yokart_products` (`prod_id`, `prod_name`, `prod_type`, `prod_brand_id`, `prod_taxcat_id`, `prod_cost`, `prod_price`, `prod_stock`, `prod_model`, `prod_condition`, `prod_published`, `prod_publish_from`, `prod_stock_out_sellable`, `prod_cod_available`, `prod_self_pickup`, `prod_min_order_qty`, `prod_from_origin_country_id`, `prod_sbpkg_id`, `prod_max_order_qty`, `prod_description`, `prod_sold_count`, `prod_created_by_id`, `prod_updated_by_id`, `prod_created_on`, `prod_updated_on`) VALUES
(295, 'Benefiance Wrinkle Smoothing Eye Cream, 0.51-oz.', 1, 100, 1, '25', 70.00, '20', '2515', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 18, 1, 5, '<p>An anti-aging eye cream that hydrates and visibly corrects wrinkles in just 1 week.*</p>\n<p>WHAT IT DOES:</p>\n<p>Visibly corrects wrinkles in just 1 week*</p>\n<p>Targets six types of eye wrinkles, including crow\'s feet, corner crinkling, under-eye wrinkles, lid creases, under-puff lines and stress wrinkles between the brows</p>\n<p>Skin is left smooth, resilient with a youthful looking radiance and hydrated for 48 hours</p>\n<p>KEY INGREDIENTS:</p>\n<p>ReNeura Technology+&trade; features Natsume and Active Response Powder Ashitaba to help improve skin receptivity to awaken and maintain the effectiveness of your treatment over time</p>\n<p>KOMBU-Bounce Complex: Formulated with green, brown, and red algae which helps address the look of wrinkle formation</p>\n<p>Mukurossi, Chlorella, Gambir and Turmeric Extracts help prevent the appearance of wrinkles by targeting key skincare factors which can cause wrinkles to appear</p>\n<p>Aqua Peptide complex features three active ingredients that target vertical stress wrinkles between the brows and enhance skin\'s softness, helping to make it more resistant to crease marks</p>\n<p>HOW TO USE:</p>\n<p>Use morning and night as the last step in your skincare routine</p>\n<p>Scoop a pearl-size amount using the included spatula</p>\n<p>Dot all around the eye area from the inner corners to the brow bone</p>\n<p>Using your ring finger, gently massage the cream into your skin working upward and outward</p>\n<p>RESULTS:</p>\n<p>Rapid Results:</p>\n<p>Visibly corrects wrinkles in just 1 week with ReNeura Technology+&trade;*</p>\n<p>After 4 weeks of use:</p>\n<p>83% of women saw corner crinkling wrinkles improve**</p>\n<p>81% of women saw under-eye wrinkles improve**</p>\n<p>80% of women saw lid crease lines improve**</p>\n<p>85% of women saw wrinkles between brows improve**</p>\n<p>After 8 weeks of use:</p>\n<p>83% of women saw under-puff line wrinkles improve**</p>\n<p>81% of women saw crow\'s feet wrinkles improve**</p>\n<p>*Tested on 35 women</p>\n<p>**Tested on 100 women age 35-46</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 10:23:09'),
(296, 'Vitamin Enriched Face Base Priming Moisturizer, 1.7-oz.', 1, 105, 1, '19', 60.00, '28', '9652', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 57, 1, 5, '<p>A Bobbi Brown bestseller&mdash;a primer plus moisturization for smooth makeup application (it\'s the best of both worlds). Rich in feel, but never greasy, this advanced face formula, with shea butter, instantly hydrates, softens, and cushions skin.</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-09-17 10:22:59'),
(297, 'TL Advanced Tightening Neck Cream Plus, 1.7-oz.', 1, 99, 1, '30', 95.00, '119', '4513', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 220, 1, 25, '<p>This #1 selling neck cream just got upgraded and is everything you need for a more youthful-looking neck and d&eacute;collet&eacute; in one powerful formula. This powerful cream features the breakthrough Gravitite-CF Lifting Complex to improve skin elasticity and provide visible lift, while smoothing the appearance of horizontal neck lines and sagging. Botanically derived Brightening Complex helps even skin tone on the d&eacute;collet&eacute; while patented NIA-114 technology strengthens the skin barrier. The effects of gravity appear reversed for more refined, toned definition. After just 8 weeks, 90% of users reported tighter, more lifted skin on the neck and d&eacute;collet&eacute;.* Don\'t send a face cream to do a neck cream\'s job.</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 10:22:51'),
(298, 'Acne Facial Cleanser, 6-oz.', 1, 106, 1, '5', 15.00, '21', '5612', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 98, 1, 15, '<p>Deep clean pores so oily, congested skin feels exceptionally clean. Formulated with salicylic acid and a soothing blend of botanical extracts (like aloe, chamomile and thyme), this daily face wash boasts exfoliating properties that help break down impurities and encourage a balanced, healthy-looking complexion.</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-09-17 10:22:42'),
(299, 'Greek Yoghurt Foaming Cream Cleanser, 5.07 fl oz.', 1, 107, 1, '10', 25.00, '52', '41544', 1, 1, '2020-07-27 00:00:00', 0, 1, 3, 1, 18, 1, 15, '<p>Indulgent soap-free, foaming cream cleanser formulated with nourishing Greek yoghurt to effectively remove makeup and impurities. The original Milk Proteins Foaming Cleanser formula you love has been boosted with Greek yoghurt to deliver two and a half times more skin soothing and nourishing proteins. With the same rich texture, heavenly scent and cleansing power, this luxurious cleanser is rich in proteins, minerals and vitamins to gently cleanse while nourishing, leaving skin soft and supple. It easily removes impurities, makeup and mascara without irritation.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', 0, 0, 0, '0000-00-00 00:00:00', '2020-08-20 06:13:23'),
(300, 'LUNAâ¢ 2', 1, 108, 1, '55', 0.00, 'NULL', '1152', 1, 1, '2020-07-27 00:00:00', 0, 1, 2, 1, 2, 1, 10, '<p>Using your hands or harsh bristled brushes to cleanse your face is fast going out of fashion. The LUNA&trade; range removes 99.5% of dirt and impurities while being 35X more hygienic than your standard bristled facial-cleansing brushes. Our devices not only bring high-tech into skincare, but can go wherever you go. The LUNA&trade; 2 is an enhanced T-Sonic&trade; facial-cleansing and anti-aging system in a revolutionary design for completely personalized cleansing. Our next-generation cleansing brush utilizes up to 2X the T-Sonic&trade; power to unclog pores of makeup residue, dirt, and oil, improving the absorption of your favorite skincare products. Its reverse anti-aging side uses lower-frequency pulsations to visibly reduce fine lines and wrinkles, as well as leaves the skin looking firm and lifted. The LUNA&trade; 2 range features 4 specialized brush types for a tailor-made experience.</p>', 1, 0, 0, '0000-00-00 00:00:00', '2020-08-10 07:47:50'),
(301, 'Burgundy Solid Tote Bag', 1, 10, 1, '39.99', 49.99, '50', 'MNG202', 1, 1, '2020-07-20 00:00:00', 1, 1, 3, 1, 101, 1, 1, '<div>\n<p class=\"pdp-product-description-content\">Burgundy solid tote bag<br />1 main compartment with zip separator sleeve<br />Tablet sleeve: No<br />Two Handles</p>\n</div>\n<div class=\"pdp-sizeFitDesc\">\n<h4 class=\"pdp-sizeFitDescTitle pdp-product-description-title\">Size &amp; Fit</h4>\n<p class=\"pdp-sizeFitDescContent pdp-product-description-content\">Height: 30 cm&nbsp; |&nbsp; Width: 49 cm&nbsp; |&nbsp; Depth: 13 cm</p>\n</div>\n<div class=\"pdp-sizeFitDesc\">\n<h4 class=\"pdp-sizeFitDescTitle pdp-product-description-title\">Material &amp; Care</h4>\n<p class=\"pdp-sizeFitDescContent pdp-product-description-content\">PU<br />Wipe with a clean, dry cloth to remove dust</p>\n</div>\n<div class=\"index-sizeFitDesc\">\n<div>\n<div class=\"index-sizeFitDesc\">\n<h4 class=\"index-sizeFitDescTitle index-product-description-title\">Complete The Look</h4>\n<p class=\"index-sizeFitDescContent index-product-description-content\">This stylish handbag from MANGO is a must-have addition to your outfit. For a chic work outfit, style this burgundy piece with slick black jeans, a trendy top, and some platform heels.</p>\n</div>\n</div>\n</div>', 0, 1, 1, '2021-03-24 07:33:34', '2021-03-24 07:33:34'),
(302, 'Calvin Klein Printed Handheld Bag', 1, 8, 1, '59.99', NULL, NULL, '13678226', 1, 1, '2020-07-20 00:00:00', 0, 1, 1, 1, 101, 1, 1, '<div>\n<p class=\"pdp-product-description-content\">Brown printed handheld bag, has a zip closure<br />1 main compartment<br />Tablet sleeve: No<br />With a detachable sling strap</p>\n</div>\n<div class=\"pdp-sizeFitDesc\">\n<h4 class=\"pdp-sizeFitDescTitle pdp-product-description-title\">Size &amp; Fit</h4>\n<p class=\"pdp-sizeFitDescContent pdp-product-description-content\">Height: 20 cm&nbsp; |&nbsp; Width: 29 cm&nbsp; |&nbsp; Depth: 15.5 cm</p>\n</div>\n<div class=\"pdp-sizeFitDesc\">\n<h4 class=\"pdp-sizeFitDescTitle pdp-product-description-title\">Material &amp; Care</h4>\n<p class=\"pdp-sizeFitDescContent pdp-product-description-content\">PU<br />Wipe with a clean, dry cloth to remove dust</p>\n<h4 class=\"index-sizeFitDescTitle index-product-description-title\">Complete The Look</h4>\n<p class=\"index-sizeFitDescContent index-product-description-content\">Stylish and durable, this handbag from Calvin Klein is a must-have wardrobe accessory. Team this brown piece with trim denim, leather boots, and a classic leather jacket for an edgy concert look.</p>\n</div>', 0, 1, 1, '2021-03-24 07:50:11', '2021-03-24 07:50:11'),
(303, 'Kenneth Cole Beige Solid Handheld Bag', 1, 24, 1, '69.99', 79.99, '21', '9970379', 1, 1, '2020-07-20 00:00:00', 0, 1, 3, 1, 101, 1, 1, '<div>\n<p class=\"pdp-product-description-content\">Beige solid handheld bag, has a zip closure<br />1 main compartment, 2 external and Multiple inner pockets<br />Tablet sleeve: No<br />Two Handles with a detachable sling strap</p>\n</div>\n<div class=\"pdp-sizeFitDesc\">\n<h4 class=\"pdp-sizeFitDescTitle pdp-product-description-title\">Size &amp; Fit</h4>\n<p class=\"pdp-sizeFitDescContent pdp-product-description-content\">Height: 20 cm&nbsp; |&nbsp; Width: 25 cm&nbsp; |&nbsp; Depth: 13 cm</p>\n</div>\n<div class=\"pdp-sizeFitDesc\">\n<h4 class=\"pdp-sizeFitDescTitle pdp-product-description-title\">Material &amp; Care</h4>\n<p class=\"pdp-sizeFitDescContent pdp-product-description-content\">PU<br />Wipe with a clean, dry cloth to remove dust</p>\n<h4 class=\"index-sizeFitDescTitle index-product-description-title\">Complete The Look</h4>\n<p class=\"index-sizeFitDescContent index-product-description-content\">Treat yourself to a fashionable handbag by Kenneth Cole and look stylish all year long. Match this beige bag with one of your favourite tees, some slim jeans, and a pair of patent pumps for a stunning date outfit.</p>\n</div>', 1, 1, 1, '2021-03-24 08:07:15', '2021-03-24 08:07:15'),
(304, 'ALDO Pink Textured Sling Bag', 1, 112, 1, '19.99', 39.99, '11', 'Product Code: 11560094', 1, 1, '2020-07-20 00:00:00', 1, 1, 2, 1, 101, 1, 1, '<div>\n<p class=\"pdp-product-description-content\">Pink textured sling bag, has a button closure<br />1 main compartment, 3 inner pockets<br />Tablet sleeve: No<br />One Handle with a detachable sling strap<br />Warranty: 1 month<br />Warranty provided by brand/manufacturer</p>\n</div>\n<div class=\"pdp-sizeFitDesc\">\n<h4 class=\"pdp-sizeFitDescTitle pdp-product-description-title\">Size &amp; Fit</h4>\n<p class=\"pdp-sizeFitDescContent pdp-product-description-content\">Height: 13 cm&nbsp; |&nbsp; Width: 22 cm&nbsp; |&nbsp; Depth: 4.5 cm</p>\n</div>\n<div class=\"pdp-sizeFitDesc\">\n<h4 class=\"pdp-sizeFitDescTitle pdp-product-description-title\">Material &amp; Care</h4>\n<p class=\"pdp-sizeFitDescContent pdp-product-description-content\">Synthetic<br />Wipe with a clean, dry cloth to remove dust</p>\n<h4 class=\"index-sizeFitDescTitle index-product-description-title\">Complete The Look</h4>\n<p class=\"index-sizeFitDescContent index-product-description-content\">This stylish handbag from ALDO is a must-have addition to your outfit. For a chic work outfit, style this pink piece with slick black jeans, a trendy top, and some platform heels.</p>\n</div>', 1, 1, 1, '2021-03-24 08:20:32', '2021-03-24 08:20:32'),
(305, 'Aura round brilliant diamond studs', 1, 113, 1, '2000', 3950.00, '20', 'E102195', 1, 1, '2020-07-23 00:00:00', 1, 1, 2, 1, 202, 1, 1, '<p>Epitomized by these diamond stud earrings, the My First De Beers collection encompasses petite versions of our most classic designs. In these earrings, our Aura motif is simplified to pure geometry. A ~0.20 carat round brilliant solitaire is prong-set on each earring and framed by a perfect circle of micropav&eacute; diamonds. We expertly match our consciously-sourced natural diamonds to create a harmonious pair. The resulting 18K rose gold and diamond earrings are an understated example of the classic beauty of a De Beers diamond.</p>', 0, 1, 1, '2021-03-24 08:48:38', '2021-03-24 08:48:38'),
(306, 'Enchanted Lotus sleepers in rose gold', 1, 113, 1, '1250', 2500.00, '20', 'E102143', 1, 1, '2020-07-23 00:00:00', 1, 1, 3, 1, 202, 1, 1, '<p>The lotus flower has long been a symbol of purity. In this elegant pair of diamond earrings, it is captured forever in delicate threads of micropav&eacute; set in 18K rose gold. Four petals radiate out from the central round brilliant diamond, in an openwork construction which lends this piece a sense of weightlessness. This elegant composition totals 8.0 mm in height and width, and is suspended from a micropav&eacute; hoop. The total diamond weight of these earrings is ~0.35 carats, each diamond ethically sourced and meticulously set by hand. These earrings would wear beautifully alongside a necklace or bracelet from the Enchanted Lotus collection.</p>', 0, 1, 1, '2021-03-24 11:28:55', '2021-03-24 11:28:55'),
(307, 'DB Classic emerald-cut diamond studs', 1, 113, 1, '7500', 11200.00, '10', 'E102198', 1, 1, '2020-07-23 00:00:00', 1, 1, 2, 1, 202, 1, 1, '<p>These elegant platinum diamond studs are composed around two ~0.70 carat emerald-cut diamonds, prong-set for ultimate Brilliance. For pure timeless elegance, the emerald-cut diamond appeals to lovers of both contemporary and vintage styles alike. As in every piece of De Beers jewellery, these diamonds have been ethically sourced, selected by eye and hand-set by a team of artisans.</p>', 0, 1, 1, '2021-03-24 11:47:25', '2021-03-24 11:47:25'),
(308, 'Dewdrop ear cuff in white gold', 1, 113, 1, '1000', 1400.00, '12', 'E103115', 1, 1, '2020-07-23 00:00:00', 1, 1, 2, 1, 202, 1, 1, '<p>Inspired by the hopeful twinkle of dew at dawn, this 18k white gold ear cuff is a modern take on the iconic Dewdrop design. Playful and multifunctional, the ear cuff holds with a clip, allowing for it to be placed anywhere on the ear. All diamonds in this piece are consciously sourced and meticulously set by De Beers&rsquo; team of experts, their weight totalling ~0.24 carats.</p>', 0, 1, 1, '2021-03-24 11:55:53', '2021-03-24 11:55:53'),
(309, 'PETITE MELROSE', 1, 114, 1, '110', NULL, NULL, 'DW00100217', 1, 1, '2020-07-23 00:00:00', 1, 1, 3, 1, 36, 1, 5, '<h2>A TRUE STYLE STATEMENT</h2>\n<p>This Petite Melrose features a black dial that accentuates classic elegance while adding a splash of refreshing attitude. This watch has you ready to go from office to rooftop party in the blink of an eye.</p>\n<p>&nbsp;</p>\n<p>*Please note that the watch size mentioned (28mm / 32mm / 36mm / 40mm) is the diameter that is measured from Bezel to Bezel.</p>', 0, 1, 1, '2021-03-24 12:42:57', '2021-03-24 12:42:57'),
(310, 'PETITE SHEFFIELD', 1, 114, 1, '89.99', NULL, NULL, 'DW00100230', 1, 1, '2020-07-23 00:00:00', 1, 1, 3, 1, 36, 1, 10, '<h2>SOPHISTICATED MINIMALISM</h2>\n<p>The Petite with an eggshell white dial and a classic black Sheffield leather strap dresses you up for any occasion. A true design icon.</p>\n<p>*Please note that the watch size mentioned (28mm / 32mm / 36mm / 40mm) is the diameter that is measured from Bezel to Bezel.</p>', 0, 1, 1, '2021-03-24 12:51:00', '2021-03-24 12:51:00'),
(311, 'Gen 5E Darci PavÃ© Gold-Tone Smartwatch', 1, 7, 1, '499', NULL, NULL, 'MKT5127', 1, 1, '2020-07-23 00:00:00', 1, 1, 3, 1, 217, 1, 1, '<div class=\"design-section\">\n<p class=\"design\">A little glam, a little next-generation technology&mdash;our pav&eacute;-accented Gen 5E Darci smartwatch delivers refined style for everyday wear. Crafted from gold-tone stainless steel and powered by Wear OS by Google&trade;, this timepiece features a built-in speaker for Bluetooth-enabled calling, estimated heart-rate tracking, payment methods and more to support your daily wellness needs.</p>\n</div>\n<div class=\"detail-section\"><span class=\"pdp-label\">DETAILS</span>\n<div>\n<div class=\"detail\">&bull; Oversized smartwatch<br />&bull; Powered by Wear OS by Google&trade;<br />&bull; Compatible with iPhone&reg; and Android&trade; phones<br />&bull; Gold-tone stainless steel<br />&bull; Pav&eacute; topring<br />&bull; Oversized<br />&bull; 43mm case<br />&bull; AMOLED Display: active-matrix organic light-emitting diode<br />&bull; Social media updates<br />&bull; Text/email alerts<br />&bull; App notifications<br />&bull; Smart help from Google<br />&bull; Built-in fitness tracking<br />&bull; Voice-activated Google assistant<br />&bull; Estimated heart rate tracking<br />&bull; Swimproof technology<br />&bull; Payment technology<br />&bull; GPS distance tracking<br />&bull; Display animation<br />&bull; Clasp fastening<br />&bull; Compatible with Heart Rate Smartwatch Charger<br />&bull; Water resistant up to 5 ATM<br />&bull; 2-year warranty<br />&bull; Imported</div>\n</div>\n</div>', 1, 1, 1, '2021-03-24 12:59:45', '2021-03-24 12:59:45'),
(312, 'Park Watch, 34mm', 1, 27, 1, '150', NULL, NULL, 'W1572', 1, 1, '2020-07-23 00:00:00', 1, 1, 3, 1, 214, 1, 1, '<p>Named for the glamorous New York City street, the Park is an elegant stainless steel evening style that shimmers with crystals.</p>\n<ul>\n<li>Stainless steel case and bracelet</li>\n<li>Approx. case diameter: 34mm</li>\n<li>Crystals from Swarovski&reg;</li>\n<li>Mineral crystal</li>\n<li>Quartz movement</li>\n<li>Deployment closure</li>\n<li>Water-resistant to 99 feet</li>\n<li class=\"style-number\">Style No.&nbsp;W1572</li>\n</ul>\n<p>Clean and condition leather watchbands with our&nbsp;<a href=\"https://www.coach.com/shop/women-accessories-product-care\"><u>Coach Leather Cleaner and Coach Leather Moisturizer</u></a>.</p>\n<p>Clean ceramic, rubber and metal watchbands with a soft, damp cloth and a touch of non-moisturized liquid soap if needed. Remove the watchband from the case before you begin. Do not soak the watchband in water, as this can cause the pins to rust.</p>', 0, 1, 1, '2021-03-24 13:07:51', '2021-03-24 13:07:51'),
(314, 'Tiffany VictoriaÂ® Ring', 1, 115, 1, '199', NULL, NULL, '2399', 1, 1, '2020-07-23 00:00:00', 1, 1, 2, 1, 19, 1, 1, '<p class=\"product-description__container_long-desc\">Inspired by the fire and radiance of our superlative diamonds, Tiffany Victoria uses a unique combination of cuts for a distinctly romantic sensibility. Delicate in form, this design possesses timeless glamour and sophistication.</p>\n<ul class=\"product-description__container_detail_list\">\n<li class=\"product-description__container_list\"><span class=\"product-description__container_list-content\">18k rose gold with diamonds</span></li>\n<li class=\"product-description__container_list\"><span class=\"product-description__container_list-content\">Marquise diamonds, carat total weight .32</span></li>\n<li class=\"product-description__container_list\"><span class=\"product-description__container_list-content\">Round brilliant diamonds, carat total weight .12</span></li>\n</ul>', 0, 1, 1, '2021-03-24 13:27:33', '2021-03-24 13:27:33'),
(315, 'Sixteen Stone Ring', 1, 115, 1, '199', NULL, NULL, '43878', 1, 1, '2020-07-23 00:00:00', 1, 1, 3, 1, 17, 1, 1, '<p class=\"product-description__container_long-desc\">Jean Schlumberger&rsquo;s visionary creations are among the world&rsquo;s most intricate designs. Brilliant diamonds alternate with golden X\'s to create this dazzling design.</p>\n<ul class=\"product-description__container_detail_list\">\n<li class=\"product-description__container_list\"><span class=\"product-description__container_list-content\">18k gold and platinum with round brilliant diamonds</span></li>\n<li class=\"product-description__container_list\"><span class=\"product-description__container_list-content\">Carat total weight 1.14</span></li>\n</ul>', 0, 1, 1, '2021-03-24 13:31:13', '2021-03-24 13:31:13'),
(316, 'X Closed Narrow Ring', 1, 115, 1, '299', NULL, NULL, 'AS12', 1, 1, '2020-07-23 00:00:00', 1, 1, 3, 1, 13, 1, 1, '<p class=\"product-description__container_long-desc\">Highly polished 18k rose gold and four hand-set diamonds define this closed narrow ring style. The sleek knife edge profile of this design&mdash;a code of the house since the introduction of the Tiffany&reg; Setting engagement ring in 1886&mdash;is pushed to a magnified scale for bold visual impact. Wearable emblems inspired by the Roman numerals on the iconic clock at the New York flagship store, the Atlas X collection is a reminder to take time into your own hands and treasure what matters most. This stackable ring looks just as sleek worn solo as it does paired with other Atlas X rings of varying widths.</p>\n<ul class=\"product-description__container_detail_list\">\n<li class=\"product-description__container_list\"><span class=\"product-description__container_list-content\">18k rose gold with four round brilliant diamonds</span></li>\n<li class=\"product-description__container_list\"><span class=\"product-description__container_list-content\">4.5 mm wide</span></li>\n<li class=\"product-description__container_list\"><span class=\"product-description__container_list-content\">Carat total weight .10</span></li>\n</ul>', 1, 1, 1, '2021-03-24 13:34:00', '2021-03-24 13:34:00'),
(317, 'Paloma\'s Studio Hexagon Ring', 1, 115, 1, '599', NULL, NULL, '323', 1, 1, '2020-07-23 00:00:00', 1, 1, 3, 1, 10, 1, 1, '<p class=\"product-description__container_long-desc\">The Paloma\'s Studio collection celebrates the designer&rsquo;s love of exuberant color combinations and bold design. This hexagon ring features a custom-cut blue topaz framed in an 18k gold setting. Stack this ring with other Paloma\'s Studio rings for a unique look that\'s all your own.</p>\n<ul class=\"product-description__container_detail_list\">\n<li class=\"product-description__container_list\"><span class=\"product-description__container_list-content\">18k gold with a blue topaz</span></li>\n<li class=\"product-description__container_list\"><span class=\"product-description__container_list-content\">12 mm diameter</span></li>\n<li class=\"product-description__container_list\"><span class=\"product-description__container_list-content\">Carat weight 3.5</span></li>\n<li class=\"product-description__container_list\"><span class=\"product-description__container_list-content\">Original designs copyrighted by Paloma Picasso</span></li>\n</ul>', 0, 1, 1, '2021-03-24 13:38:20', '2021-03-24 13:38:20');
